import React, { useState } from "react";
import { Box } from "@mui/system";
import TextField from "@mui/material/TextField";

function UserList() {
  return (
    <Box
      sx={{
        width: 500,
        maxWidth: "100%",
        bgcolor: "white",
        borderRadius: "20px",
      }}
      position="relative"
      bottom="28rem"
      left="40rem"
    >
      <TextField
        fullWidth
        label="Enter Your Workout For Today"
        id="fullWidth"
      />
    </Box>
  );
}

export default UserList;
